import { useEffect} from 'react'
import {BitcoinComponent} from '../Components/BitcoinComponent'
import {EthereumComponent} from '../Components/EthereumComponent'
import axios from 'axios'
import '../Style/home.css'

const Home: React.FC = () => {

    return(
        <div className='home-div'>
            <h1>Cryptos</h1>
            <BitcoinComponent showSellButton={false} coin={"bitcoin"}/>
            <EthereumComponent showSellButton={false} coin={"ethereum"}/>
        </div>
    )
}

export default Home;
